import './App.css';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";

import NavBar from './components/NavBar';
import { Home } from './components/Home';
import About from './components/About';

function App() {
  return (
    <>
      <NavBar />
      <Router>

        <Routes>
          <Route exact path="/">
            <Home />


          </Route>
          <Route path="/about">
            <About />
          </Route>
        </Routes>
      </Router>

    </>
  );
}

export default App;
